import React from "react";
import { Outlet } from "react-router-dom";

const UserRoot = () => {
  return (
    <div className="wrapper2">
      <div className="nav">
        <ul>
          <li>
            <a href="">edit</a>
          </li>
          <li>
            <a href="">Logout</a>
          </li>
        </ul>
      </div>
      <div className="content">
        <Outlet />
      </div>
    </div>
  );
};

export default UserRoot;
